function Todo(props) {
  return (
    <div key={todo} className="todo-element row">
      <div className="col-9">
        <h3>{todo}</h3>
      </div>
      <div className="col-3">
        <button
          className="btn btn-danger btn-sm"
          onClick={() => props.handleDelete(todo)}
        >
          Delete
        </button>
        <button
          className="btn btn-danger btn-sm"
          onClick={() => props.handleEdit(todo)}
        >
          Edit
        </button>
      </div>
    </div>
  );
}
